import React from "react";
import PopupWithForm from "./PopupWithForm";


function ProveDeleteCardPopup({ isOpen, onClose, onProveDeleteCard, selectedСard }) {

  function handleSubmit(e) {
    e.preventDefault();
    onProveDeleteCard(selectedСard);
  }

  return (
    <PopupWithForm
      isOpen={isOpen}
      onClose={onClose}
      onSubmit={handleSubmit}
      name="popup-delete"
      title="Вы уверены?"
      children={
        <>
          <button
            type="button"
            className="popup__submit"
            >
            Да
          </button>
        </>
      }
    />
  )

}

export default ProveDeleteCardPopup;
